import styles from "./Skills.module.css";

function OutputSkills(props){
    var addedData = []
    addedData.push({
        language: props.language,
        experience: props.experience
    });
    console.log(addedData[0])
    return(          
        (
        <div className={styles.output}>
          <p className={styles.p1}>{addedData.language[0]}</p>
          <p className={styles.p2}>Years of Experience: {addedData.experience[0]}</p>
          <button>-</button>
        </div>

      ))

}
export default OutputSkills
